// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0;

contract Lottary {
    struct Players{
        uint amount;
        address  userAdd;
    }
   Players[] public players;

    address manager;

    // //winner player;

    address payable public winner;

    constructor() {
        manager = msg.sender;
    }

    function exists(address v) public view returns (uint) {
        for (uint256 i = 0; i < players.length; i++) {
            if (v == players[i].userAdd) {
                return i+1;
            }

        }
        return 0;
    }

    receive() external payable {
        require(msg.value >= 1 ether, "Please pay 1 atleast 1 ether");
        uint value=exists(msg.sender);
        if (value==0) {
            Players  memory newplayer=Players(msg.value,msg.sender);
            players.push(newplayer);

        } else {
            players[value-1].amount += msg.value;
        }
    }
    function allPlayers() public view returns (Players [] memory) {
        return players;
    }
    function random() internal view returns (uint256) {
        return
            uint256(
                keccak256(
                    abi.encodePacked(
                        block.timestamp,
                        block.difficulty,
                        block.number
                    )
                )
            );
    }

    function getBalance() public view returns (uint256) {
        require(manager == msg.sender, "error found ");
        return address(this).balance;
    }

    function pickWinner() public {
        require(msg.sender == manager, "you are not the manager");
        require(players.length >= 3, "players are less than 3");
        uint256 r = random();
        uint256 index = r % players.length;
        winner=payable(players[index].userAdd);
        winner.transfer(getBalance());
        // //then reset our players

        // mapping(address => uint256) storage players1 = players;
      delete players;
    }


}
